const Home = () => (
  <section className="page home">
    
    <h1>Hi, I am Satyansh</h1>
    <h2>MBA-Hospital Administration and Healthcare Management</h2>
    <p>Crafted with Purpose. Driven by Passion.</p>
  </section>
);

export default Home;
